import React from 'react';

const Card = (data) => (
    <div className='supply__container'>
        {
            this.state.newCards.map((element) => {
                return(
                    <Card 
                        name={element.name}
                        cost={element.cost}
                        img={element.img}
                    />
                )
            })
        }
    </div>
)

export default Card;
